(57, 'Hello', '<h2 >The world wide web markup</h2><figure class=\"image ck-widget image-style-align-right image_resized ck-widget_with-resizer\" contenteditable=\"false\"><img src=\"https://ckeditor.com/docs/ckeditor5/latest/assets/img/html5-icon.png\" alt=\"HTML 5 icon.\"><div class=\"ck ck-reset_all ck-widget__type-around\"><div class=\"ck ck-widget__type-around__button ck-widget__type-around__button_before\" title=\"Insert paragraph before block\"></div><div class=\"ck ck-widget__type-around__button ck-widget__type-around__button_after\" title=\"Insert paragraph after block\"></div><div class=\"ck ck-widget__type-around__fake-caret\"></div></div><div class=\"ck ck-reset_all ck-widget__resizer\" id=\"div_spc\" style=\"display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view\" style=\"display: none;\"></div></div></figure><p>The <strong>Hypertext Markup Language</strong>, most often referred to as simply <abbr title=\"HyperText Markup Language\"><strong>HTML</strong></abbr>, is a standard <i>markup language</i> for web browsers. It was first practically implemented by Tim Berners-Lee in 1991, although it was already theoretically designed much earlier, in fact as early as 1980.</p><h3>The HTML structure</h3><p>HTML uses elements â€“ called <i>tags</i> â€“ to describe the style and semantics of the content. They are also used to introduce non-textual elements. The tags are shortcodes surrounded by angle brackets.</p><h3>The types of HTML elements</h3><h4>The semantic tags</h4><p>The <i>semantic</i> tag would be eg.</p><h2>elements, describing level 2 headings (there are six levels of these), like the one above. This type of elements needs bo</h2><p>for paragraphs (like this one) or <a>for links (seen at the beginning).</a></p><h4><a>The content tags</a></h4><p><a>The other type â€“ <i>content</i> tag â€“ includes elements such asÂ <span class=\"image-inline ck-widget\" contenteditable=\"false\"><span class=\"image-inline ck-widget\" contenteditable=\"false\"><img></span></span>Â which does not require a closing tag. It is used to include an image in the content.</a></p><p><a>There are some more <abbr title=\"HyperText Markup Language\">HTML</abbr> tags, that may combine both of these aims. One of these would be the <abbr>tag, which is used to explain abbreviations on hover.</abbr></a></p><div class=\"ck-fake-selection-container\" style=\"left:-9999px;position:fixed;top:0px;width:42px;\"><a>HTML 5 icon. image widget</a></div>', '0000-00-00 00:00:00'),
