(59, 'It Industry', '<p ><span style=\"background-color:hsl(270,75%,60%);color:hsl(180,75%,60%);\">this is title</span></p><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"display:none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"><br data-cke-filler=\"true\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"><br data-cke-filler=\"true\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"><br data-cke-filler=\"true\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"><br data-cke-filler=\"true\"></div></div><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(32, 33, 34);font-family:sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin:0.5em 0px;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">orn at <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Wazir_Mansion\" title=\"Wazir Mansion\">Wazir Mansion</a> in <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Karachi\" title=\"Karachi\">Karachi</a>, Jinnah was trained as a <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Barrister\" title=\"Barrister\">barrister</a> at <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Lincoln%27s_Inn\" title=\"Lincoln^s Inn\">Lincoln^s Inn</a> in <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/London\" title=\"London\">London</a>, England. Upon his return to <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/British_Raj\" title=\"British Raj\">India</a>, he enrolled at the <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Bombay_High_Court\" title=\"Bombay High Court\">Bombay High Court</a>,Â <span class=\"image-inline ck-widget ck-widget_with-resizer image_resized image-style-align-left\" contenteditable=\"false\" style=\"width:12.7%;\"><img src=\"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRQVh6XPMu-mshSB3-KvO0BdroJPNStjhjPZhQFe5JSd0TfIBopDRhIJe75NhSkM4TpAY0&usqp=CAU\"><div class=\"ck ck-reset_all ck-widget__resizer\" style=\"height: 94px; left: 0px; top: 0px; width: 124px; display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view ck-orientation-bottom-right\" style=\"display: none;\">12.7%</div></div></span>Â and took an interest in national politics, which eventually replaced his legal practice. Jinnah rose to prominence in the <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Indian_National_Congress\" title=\"Indian National Congress\">Indian National Congress</a> in the first two decades of the 20th century. In these early years of his political career, Jinnah advocated <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Hindu%E2%80%93Muslim_unity\" title=\"Hinduâ€“Muslim unity\">Hinduâ€“Muslim unity</a>, helping to shape the 1916 <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Lucknow_Pact\" title=\"Lucknow Pact\">Lucknow Pact</a> between the Congress and the All-India Muslim League, in which Jinnah had also become prominent. Jinnah became a key leader in the <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Indian_Home_Rule_movement\" title=\"Indian Home Rule movement\">All-India Home Rule League</a>, and proposed a <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Fourteen_Points_of_Jinnah\" title=\"Fourteen Points of Jinnah\">fourteen-point constitutional reform plan</a> to safeguard the political rights of <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Muslims\" title=\"Muslims\">Muslims</a> in the <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Indian_subcontinent\" title=\"Indian subcontinent\">Indian subcontinent</a>. In 1920, however, Jinnah resigned from the Congress when it agreed to follow a campaign of <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Satyagraha\" title=\"Satyagraha\"><i>satyagraha</i></a>, which he regarded as <a style=\"color:rgb(6, 69, 173);text-decoration:none;\" href=\"https://en.wikipedia.org/wiki/Anarchism\" title=\"Anarchism\">political anarchy</a>.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(32, 33, 34);font-family:sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin:0.5em 0px;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">By 1940, Jinnah had come to believe that the Muslims of the subcontinent should ha</p><p><span style=\"color:hsl(210, 75%, 60%);\">This is content</span></p>', '0000-00-00 00:00:00'),
(60, 'test', '<h3 style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:\"Open Sans\", Arial, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;letter-spacing:normal;margin:15px 0px;orphans:2;padding:0px;text-align:left;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\" ><strong>1914 translation by H. Rackham</strong></h3><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);color:rgb(0, 0, 0);font-family:\"Open Sans\", Arial, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin:0px 0px 15px;orphans:2;padding:0px;text-align:justify;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">\"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\"</p>', '0000-00-00 00:00:00'),
