(68, 'Return to politics', '<p ><span style=\"background-color:rgb(248,249,250);color:rgb(32,33,34);font-family:sans-serif;font-size:12.3704px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:left;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><span class=\"image-inline ck-widget ck-widget_with-resizer image_resized image-style-align-left\" contenteditable=\"false\" style=\"width:28.62%;\"><img src=\"https://cdn.educba.com/academy/wp-content/uploads/2020/07/psd-9-4-2-10-3.jpg\"><div class=\"ck ck-reset_all ck-widget__resizer\" id=\"div_spc\" style=\"height: 156px; left: 0px; top: 0px; width: 280px; display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view ck-orientation-bottom-right\" style=\"display: none;\">28.62%</div></div></span>Jinnah (front, left) with the Working Committee of the Muslim League after a meeting in Lucknow, October 1937</span></span></p><p><span style=\"background-color:rgb(242,242,242);color:rgb(51,51,51);font-family:\"Fira Sans\", \"Source Sans Pro\", Helvetica, Arial, sans-serif;font-size:16px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">An optional </span></span><code class=\"parameter\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(242, 242, 242);color:rgb(51, 102, 153);cursor:pointer;font:700 16px / 1.375rem \"Fira Mono\", \"Source Code Pro\", monospace;letter-spacing:normal;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">callback</code><span style=\"background-color:rgb(242,242,242);color:rgb(51,51,51);font-family:\"Fira Sans\", \"Source Sans Pro\", Helvetica, Arial, sans-serif;font-size:16px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"> function may be specified. This function takes a string as a parameter and should return a string. The function will be called when the output buffer is flushed (sent) or cleaned (with </span></span><a class=\"function\" style=\"border-bottom-style:solid;border-bottom-width:1px;color:rgb(51, 102, 153);text-decoration:none;\" href=\"https://www.php.net/manual/en/function.ob-flush.php\"><span style=\"background-color:rgb(242,242,242);color:rgb(51,51,51);font-family:\"Fira Sans\", \"Source Sans Pro\", Helvetica, Arial, sans-serif;font-size:16px;\"><span class=\"function\" style=\"-webkit-text-stroke-width:0px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">ob_flush()</span></span></a><span style=\"background-color:rgb(242,242,242);color:rgb(51,51,51);font-family:\"Fira Sans\", \"Source Sans Pro\", Helvetica, Arial, sans-serif;font-size:16px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">, </span></span><a class=\"function\" style=\"border-bottom-style:solid;border-bottom-width:1px;color:rgb(51, 102, 153);text-decoration:none;\" href=\"https://www.php.net/manual/en/function.ob-clean.php\"><span style=\"background-color:rgb(242,242,242);color:rgb(51,51,51);font-family:\"Fira Sans\", \"Source Sans Pro\", Helvetica, Arial, sans-serif;font-size:16px;\"><span class=\"function\" style=\"-webkit-text-stroke-width:0px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">ob_clean()</span></span></a><span style=\"background-color:rgb(242,242,242);color:rgb(51,51,51);font-family:\"Fira Sans\", \"Source Sans Pro\", Helvetica, Arial, sans-serif;font-size:16px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"> or similar function) or when the output buffer is flushed to the browser at the end of the request. When </span></span><code class=\"parameter\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(242, 242, 242);color:rgb(51, 102, 153);cursor:pointer;font:700 16px / 1.375rem \"Fira Mono\", \"Source Code Pro\", monospace;letter-spacing:normal;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">callback</code><span style=\"background-color:rgb(242,242,242);color:rgb(51,51,51);font-family:\"Fira Sans\", \"Source Sans Pro\", Helvetica, Arial, sans-serif;font-size:16px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"> is called, it will receive the contents of the output buffer as its parameter and is expected to return a new output buffer as a result, which will be sent to the browser. If the </span></span><code class=\"parameter\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(242, 242, 242);color:rgb(51, 102, 153);cursor:pointer;font:700 16px / 1.375rem \"Fira Mono\", \"Source Code Pro\", monospace;letter-spacing:normal;orphans:2;overflow-wrap:break-word;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">callback</code><span style=\"background-color:rgb(242,242,242);color:rgb(51,51,51);font-family:\"Fira Sans\", \"Source Sans Pro\", Helvetica, Arial, sans-serif;font-size:16px;\"><span style=\"-webkit-text-s