(76, 'trash', '<p >grrgrggr</p><figure class=\"image ck-widget ck-widget_with-resizer image_resized image-style-align-left\" contenteditable=\"false\" style=\"width:27.64%;\"><img src=\"https://www.nandaabiz.com/wp-content/uploads/2011/12/php_code.jpg\"><div class=\"ck ck-reset_all ck-widget__type-around\"><div class=\"ck ck-widget__type-around__button ck-widget__type-around__button_before\" title=\"Insert paragraph before block\"></div><div class=\"ck ck-widget__type-around__button ck-widget__type-around__button_after\" title=\"Insert paragraph after block\"></div><div class=\"ck ck-widget__type-around__fake-caret\"></div></div><div class=\"ck ck-reset_all ck-widget__resizer\" id=\"div_spc\" style=\"height: 174px; left: 0px; top: 0px; width: 271px; display: none;\"><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-left\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-top-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-right\"></div><div class=\"ck-widget__resizer__handle ck-widget__resizer__handle-bottom-left\"></div><div class=\"ck ck-size-view ck-orientation-bottom-right\" style=\"display: none;\">27.64%</div></div></figure><p>Â <span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:\"Fira Mono\", \"Source Code Pro\", monospace;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:left;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">I think it^s worth noting that while you can^t call any output functions such as echo or print from within a callback function, you can still send headers (presumably including cookies, haven^t checked). Of course this only works in the first callback, like so:</span></span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:\"Fira Mono\", \"Source Code Pro\", monospace;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:left;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Not the most inspiring example, but in this case the code is able to sneak a last-minute header in before the headers part of the response is sent. This can be handy if you want to avoid replacing header values that are uncertain.</span></span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);font-family:\"Fira Mono\", \"Source Code Pro\", monospace;font-size:14px;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:left;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">For example if your code may return an image, but you don^t want to set content type until you^re sure that the image can be sent successfully, you can use the callback to leave the decision right until the very last moment, by which point you^re hopefully sure of what^s being sent in the HTTP body.</span></span></p>', '0000-00-00 00:00:00'),
